import React from 'react';
import API from './utils/API';

function EmployeeCard() {
  let empName = "";
  // let empLastName = "";

    API.search()
      .then(res => {
        console.log("Res: "+JSON.stringify(res));
        empName = res.data.results[0].name.first;

      })
      .catch(err => console.log(err));

      return(
      <h1>{ empName }</h1>);
  }

  export default EmployeeCard;
